import Card from "../Card/Card";
import './MoviesCardList.css'

const MoviesCardList = () => {
    return (
        <section className="cards">
            <ul className="card-list">
                <li><Card/></li>
            </ul>
            <button className="card-list__more">Ещё</button>
        </section>
    );
};

export default MoviesCardList;
